 the ability to rate and write reviews for programs that they already have completed...\r\n\r\n  Scenario: Client tried to review a program that they did not complete\r\n    When Client \"eyas\" gave a rating \"9\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Muscle Mastery\"\r\n    Then Tell the client that they need to complete the program first\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client entered a non-numerical value for rating\r\n    When Client \"eyas\" gave a rating \"good!\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Weight Loss Advanced\"\r\n    Then Tell the client that the rating should be a numerical value\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client entered a value for rating outside the acceptable range\r\n    When Client \"eyas\" gave a rating \"-52\" and review \"VERY VERY BAD! MADE ME GAIN WEIGHT!\" and suggestion \"DO NOT FALL FOR THIS SCAM\" for program \"Weight Loss Advanced\"\r\n    Then Tell the client that the rating should be within the acceptable range\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client gave a bad rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"1\" and review \"it's bad! didn't lose weight at all!\" and suggestion \"Time per session is too little! More session time can save the program.\" for program \"Weight Loss Advanced\"\r\n    Then Apologize to the client and assure them that their suggestion will be considered\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave an okay rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"5\" and review \"it's okay! didn't lose much weight though!\" and suggestion \"Needs more times per session!\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their review and say that you'll try to fix the problem\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave a good rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"9\" and review \"Very good! made me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their liking of the program and the suggestion\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client chose to go back or entered an invalid input format\r\n    When Client \"eyas\" entered \"go back\"\r\n    Then send client to \"main menu\"","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Eyas\/IdeaProjects\/EyasAdamProject\/src\/Features\/ClientFeatures\/ClientCompletedProgramsRating.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Client program rating and reviewing","description":"  Giving Clients the ability to rate and write reviews for programs that they already have completed...","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"Client tried to review a program that they did not complete","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"When ","keywordType":"Action","text":"Client \"eyas\" gave a rating \"9\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Muscle Mastery\"","id":"610625c5-abe8-4a03-bf89-ee5273ca0481"},{"location":{"line":6,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Tell the client that they need to complete the program first","id":"0705879c-bf16-4a09-b296-48b1cbf8843a"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"send client to \"write a review\"","id":"72b94889-c84b-45a4-ab  info about themselves to their account like age, weight, BMI, goal BMI, goal weight, preferences and restrictions\r\n\r\n\r\n  Scenario: Client tried to update the value age to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"age\" \"80\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the age should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n  Scenario: Client tried to update the value age to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"5\" \"80\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the age should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value weight to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"mass\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the weight should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value weight to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"999\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the weight should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value BMI to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"good enough BMI (LOL)\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the BMI should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value BMI to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"2\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Then Tell the client that the BMI should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value goal BMI to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"28\" \"good enough BMI (LOL)\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the goal BMI should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value goal BMI to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"28\" \"2\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Then Tell the client that the goal BMI should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value goal weight to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"28\" \"23\" \"thin\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the goal weight should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value goal weight to a value outside than the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"28\" \"23\" \"5\" \"diary-free food  a confirmation message \"Progress updated successfully\"\r\n    Examples:\r\n      | toEditType | NewValue | ClientID |\r\n      | 1          | 40       | 1        |\r\n      | 2          | 62       | 2        |\r\n      | 3          | 40       | 1        |\r\n      | 2          | 100      | 4        |\r\n      | 1          | 40       | 5        |\r\n\r\n  Scenario: Attempt to edit a non-existing client's progress\r\n    Given I have a list of clients with progress data\r\n    And the type of the edited value is \"1\"\r\n    And the new value is \"30\"\r\n    When I edit the progress of client \"17\"\r\n    Then the system displays an error message \"This client does not exist\"\r\n\r\n  Scenario Outline: Edit the progress of a client with invalid data\r\n    Given the type of the edited value is \"<toEditType>\"\r\n    And the new value is \"<NewValue>\"\r\n    When I edit the progress of client \"<ClientID>\"\r\n    Then the system displays an error message \"<message>\"\r\n    Examples:\r\n      | toEditType | NewValue | ClientID | message                                            |\r\n      | 4          | 40       | 1        |  invalid type                                      |\r\n      | 0          | 62       | 2        |  invalid type                                      |\r\n      | -1         | 40       | 1        |  invalid type                                      |\r\n      | fff        | 40       | 1        |  invalid type                                      |\r\n      | 1          | -10      | 4        |  invalid data must be a positive number            |\r\n      | 2          | -20      | 5        |  invalid data must be a positive number            |\r\n      | 1          | bb       | 4        |  invalid data must be a positive number            |\r\n      | 3          | -20      | 1        |  invalid data must be between 0 and 100            |\r\n      | 3          | 150      | 5        |  invalid data must be between 0 and 100            |\r\n he clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program3\" about a removal\r\n  Scenario Outline: Notify clients about removals from program3\r\n    Given I have an \"remove\" in program \"program3\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | remove          |\r\n      | 9      | remove          |\r\n      | 10     | remove          |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program1\" about a removal\r\n  Scenario Outline: Notify clients about removals from program1\r\n    Given I have an \"remove\" in program \"program1\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | remove          |\r\n      | 2      | remove          |\r\n      | 3      | remove          |\r\n      | 4      | remove          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | remove          |\r\n      | 9      | remove          |\r\n      | 10     | remove          |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  Scenario: notify a program with no enrolled clients\r\n    Given I have an \"update\" in program \"program4\"\r\n    And no clients are enrolled in this program\r\n    When I notify the clients enrolled in this program\r\n    Then the system shows \"No clients are enrolled in this program\"\r\n\r\n  Scenario: notify a program that did not have any change\r\n    Given I have an \"update\" in program \"program1\"\r\n    When I notify the clients enrolled in this program with no change\r\n    Then the system shows \"No change to this program\"\r\n\r\n  Scenario: notify a program that does not exist\r\n    Given I have an \"programNEW\"\r\n    When I notify for program that does not exist\r\n    Then the system shows \"this program does not exist\"","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Eyas\/IdeaProjects\/EyasAdamProject\/src\/Features\/InstructorFeatures\/Notify-clients.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Notify clients about changes to program","description":"  As a program manager\n  I want to notify clients about updates or removals in programs\n  So that they stay informed about relevant changes","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[],"keyword":"Sc
